import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to my website.
        </p>

        <div className="Shape">
          <svg xmlns="http://www.w3.org/2000/svg" width="474.948" height="408.681" viewBox="0 0 474.948 408.681">
            <path id="Polygon_1" data-name="Polygon 1" d="M205,0,410,240H0Z" transform="matrix(0.875, 0.485, -0.485, 0.875, 116.354, 0)" fill="#fff"/>
          </svg>
        </div>
      </header>



    </div>
  );
}

export default App;
